import React from 'react';

function Body() {
    return(
        <div className="container-fluid bg-secondary">
            <div className="">
                <table className="table">
                    <thead>
                        <tr>
                        <th scope="col">#</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                        </tr>
                    </thead>
                </table>
            </div>
        </div>
    );
}

export default Body;
